module.exports = "<section>\n    <div class=\"wrap\">\n        <div class=\"content-left\" style=\"padding-right:20px\">\n            <h1><strong>NextConnect</strong></h1>\n            <p>\n                NextConnect is a web application I wrote while working at Nucor Corporation. While working on integrating a wholly owned subsidiary's data into our Oracle E-Business Suite instance we determined it would be great to have a nice, friendly user interface\n                for our end users. I set to work developing the UI and working with the subsidiary company that was providing the data. Once the application was deployed to production our users could log into NextConnect to view purchase orders, ASNs\n                (Advanced Shipping Notices), receipts, invoices and other information.\n            </p>\n            <h2>What Makes It Work?</h2>\n            <p>\n                NextConnect is almost entirely written in Angular with TypeScript. Backend data is provided via a JSON RESTful API hosted on Azure. The open source UI framework PrimeNG was used extensively and features it's premium template, Ultima which utilizes responsive\n                Material Design, HTML5 and CSS3.\n            </p>\n        </div>\n        <!-- end .content-left -->\n        <div class=\"content-left\">\n            <!-- <div class=\"embed\"> = Responsive -->\n            <h2 style=\"position:absolute;left:25%\">Video coming soon!</h2>\n            <!-- <div class=\"embed\">\n                <iframe src=\"https://www.youtube.com/embed/XjJQBjWYDTs\" allowfullscreen></iframe>\n            </div> -->\n            <!-- end .embed -->\n        </div>\n        <!-- end .content-left -->\n    </div>\n    <!-- .end .wrap -->\n    <hr>\n    <div class=\"wrap\">\n        <div class=\"content-right\" style=\"padding-left:20px\">\n            <h1><strong>tengel92.github.io</strong></h1>\n            <p>\n                Obviously the site you are currently on is a representation of my skills. I primarily wrote this website to be a personal website, blog and a way to connect with me.\n            </p>\n            <h2>What Makes It Work?</h2>\n            <p>\n                On this site I decided to write almost everything in Angular but could have likely used JavaScript only. The look and feel of this website is largely influenced by <a href=\"https://webslides.tv\" target=\"_blank\">WebSlides</a>. I also used\n                <a href=\"http://vincentgarreau.com/particles.js/\" target=\"_blank\">particles.js</a> just to add a splash of fun on the home page.\n            </p>\n        </div>\n        <!-- end .content-left -->\n        <div class=\"content-right\">\n            <!-- <div class=\"embed\"> = Responsive -->\n            <h2 style=\"position:absolute;left:25%\">Video coming soon!</h2>\n            <!-- <div class=\"embed\">\n                <iframe src=\"https://www.youtube.com/embed/XjJQBjWYDTs\" allowfullscreen></iframe>\n            </div> -->\n            <!-- end .embed -->\n        </div>\n        <!-- end .content-left -->\n    </div>\n</section>"

